import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import './AdministratorHomepage.css';
import backgroundAdmin from '../../images/bgAdmin.png';
import imageLogo from '../../images/asd.png';
import sideBarAdmin from '../../components/sideBarAdmin'
import VerifyStore from '../../components/AdminComponents/VerifyStore';
import MangeAccount from '../../components/AdminComponents/MangeAccount';
import ReportingService from '../../components/AdminComponents/ReportingService';

const AdministratorHomepage = () => {
    const [selectedButton, setSelectedButton] = useState(null);
    const navigate = useNavigate();

    const handleButtonClick = (buttonId) => {
        setSelectedButton(buttonId);
        switch (buttonId) {
            case 'account':
                navigate('account');
                break;
            case 'store':
                navigate('store');
                break;
            case 'report':
                navigate('report');
                break;
            default:
                // Handle default case if needed
                break;
        }
    };

    const renderComponent = () => {
        switch (selectedButton) {
            case 'account':
                return <MangeAccount/>;
            case 'store':
                return <VerifyStore/>;
            case 'report':
                return <ReportingService/>;
                // break;
            default:
                return 'ยินดีต้อนเข้ารับสู่ระบบของผู้ดูแลระบบคาบิซู';
        }
    };

    return (
        <>
            <sideBarAdmin/>
        </>
    );
}

export default AdministratorHomepage;
